import logo from './logo.svg';
import './App.css';
import { CalendarHeatmap } from "reactjs-calendar-heatmap";
import React from "react";

let red = "#8a0d0d";
let overview = "year";
let streamingData = null;
let print = function (val) {
    console.log(val);
};

function groupBy(rawData, key) {
    return rawData.reduce(function(previousVal, currentVal) {
        (previousVal[currentVal[key]] = previousVal[currentVal[key]] || []).push(currentVal);
        return previousVal;
    }, {});
};

fetch("StreamingHistoryDesi.json")
    .then(response => response.json())
    .then(data => {
        data.forEach(function (entry, idx, data) {
            data[idx]["date"] = data[idx].endTime.split(" ")[0];
            delete data[idx].artistName;
            delete data[idx].trackName;
            delete data[idx].endTime;
        });

        let filteredData = Object.values(groupBy(data, "date"));

        streamingData = filteredData.map(function (day) {
            let date = day[0]["date"];
            day = day.reduce(function (prev, cur) {
                prev["total"] = prev["total"] + 1;
                prev["totalPlayed"] = prev["totalPlayed"] + cur["msPlayed"];
                return prev;
            }, {"totalTracks": 0, "total": 0});
            day["date"] = date;
            return day;
        });
    })


function App() {
  return (
    <div className="App">
      <header className="App-header">
          <CalendarHeatmap
              data={streamingData}
              color={red}
              overview={overview}
              handler={print}>
          </CalendarHeatmap>
      </header>
    </div>
  );
}

export default App;
